import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 30-127 Criminal prosecutions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/30-127.md","filePath":"vacode/30-127.md"}'),r={name:"vacode/30-127.md"},o=a('<h1 id="§-30-127-criminal-prosecutions" tabindex="-1">§ 30-127 Criminal prosecutions. <a class="header-anchor" href="#§-30-127-criminal-prosecutions" aria-label="Permalink to &quot;§ 30-127 Criminal prosecutions.&quot;">​</a></h1><p>A. Violations of this chapter may be prosecuted notwithstanding the jurisdiction of, or any pending proceeding before, the House or Senate Ethics Advisory Panel.</p><p>B. Nothing in this chapter shall limit or affect the application of other criminal statutes and penalties as provided in the Code of Virginia, including but not limited to bribery, embezzlement, perjury, conspiracy, fraud, and violations of the Campaign Finance Disclosure Act Chapter 9.3 (§ <a href="http://law.lis.virginia.gov/vacode/24.2-945/" target="_blank" rel="noreferrer">24.2-945</a> et seq.) of Title 24.2.</p><p>1987, Sp. Sess., c. 1, § 2.1-639.61; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0787" target="_blank" rel="noreferrer">787</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0892" target="_blank" rel="noreferrer">892</a>.</p>',4),n=[o];function s(c,l,p,d,h,_){return i(),t("div",null,n)}const u=e(r,[["render",s]]);export{g as __pageData,u as default};
